def numFind(n):
    r, c = 0, 0
    count = 0
    while r < len(n):
        if checkTree(r, c):
            count += 1
        r += 1
        c += 3
        #print("Count: ", count)
    return count

def checkTree(r, c):
    try:
        return n[r][c] == '#'
    except:
        while c >= len(n[r]):
            n[r].extend(n[r])
            #print("except")
        return n[r][c] == '#'

